/**
 * Get all source models for a specific display type
 */
export function getModelsForDisplay(displayType: DisplayType): SourceModel[] {
  return displayType === "halloween" ? HALLOWEEN_MODELS : CHRISTMAS_MODELS;
}

/**
 * Get source models for a display type.
 * The sequenceSlug parameter is kept for backwards compatibility but
 * currently the display type determines which models are returned.
 */
export function getSourceModelsForSequence(
  displayType: DisplayType,
): SourceModel[] {
  return getModelsForDisplay(displayType);
}

/**
 * Convert our source layout to ParsedModel format for use with the matching engine.
 */
export function sourceModelToParsedModel(source: SourceModel): ParsedModel {
  const memberModels = source.memberModels || [];

  // Classify groups using the same logic as the XML parser
  const classification = source.isGroup
    ? classifyGroup(source.name, memberModels)
    : undefined;

  const model: ParsedModel = {
    name: source.name,
    displayAs: source.displayAs,
    type: source.type,
    pixelCount: source.pixelCount,
    parm1: 0,
    parm2: 0,
    parm3: 0,
    stringType: "RGB Nodes",
    startChannel: "",
    worldPosX: source.posX * 2000 - 1000,
    worldPosY: source.posY * 200,
    worldPosZ: 0,
    submodels: source.submodels.map((name) => ({
      name,
      type: "ranges",
      rangeData: "",
      pixelCount: 0,
    })),
    isGroup: source.isGroup,
    aliases: [],
    memberModels,
  };

  if (classification) {
    model.groupType = classification.groupType;
    model.parentModels = classification.parentModels;
    model.semanticCategory = classification.semanticCategory;
    model.entityType = classification.groupType;
  } else {
    model.entityType = getEntityType(model);
  }

  return model;
}
